export default {
  game: false,
  barReady: false,
  bricks: Array.apply(null, Array(14 * 6)).map((v, id) => {
    if (id !== 0) {
      return { id, alive: false };
    } else {
      return { id, alive: true };
    }
  }),
  ballvel: 6,
  ballxvel: Math.random() < 0.5 ? -1 : 1,
  ballyvel: 1,
  lives: 3
};
